import React, {Component} from 'react';
import './SidebarItem.css';

const SidebarItem = (props) =>
{
  itemStyle = {
    height: props.height,
    borderRadius:'20px',
    width:'100%',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    border: '1px solid #555'
  }

  return (
    <button className='SidebarItem' style={this.itemStyle} onClick={this.props.click}>
      {this.props.children}
    </button>
  );
}
export default SidebarItem;
